// src/pages/TournamentsPage.jsx

import React from "react";
import TournamentList from "../components/TournamentList";
import { useNavigate } from "react-router-dom";

export default function TournamentsPage() {
  const navigate = useNavigate();

  function handleAddTournament() {
    navigate("/superadmin/tournaments/new/setup");
  }

  function handleEditTournament(tournament) {
    navigate(`/superadmin/tournaments/${tournament.id}/setup`);
  }

  return (
    <div className="p-6 max-w-5xl mx-auto">
      <TournamentList onAdd={handleAddTournament} onEdit={handleEditTournament} />
    </div>
  );
}
